import React from 'react'
import logo from '../images/cyberpunk.png'
class NavBar extends React.Component {
    render(){
        return (
        <div>
               <a href="/">
                   <img src={logo} alt="Logo"/>
                   <span className= "">CyberPunk</span>
                   <span>Conf</span>
               </a>
            </div>
        )
    }
}
export default NavBar;
